    // DESCRIPTION: "DESCRIÇÃO DO SERVIÇO",
    DESCRIPTION: "DESCRIPTION OF SERVICE",
    // DESCRIPTION_P1: "Cashero é um aplicativo seguro baseado em dispositivos móveis que fornece uma plataforma segura para economias de alto rendimento, carteiras em várias moedas e pagamentos internos e internacionais instantâneos e sem taxas. O Cashero permite que os usuários depositem libras esterlinas, euros e dólares americanos para gerar juros. Os juros são gerados pela conversão de GBP, EUR e USD depositados em uma cesta de stablecoins de criptomoeda, ou seja, DAI e USDC, que são investidos em protocolos descentralizados no Ethereum e outros blockchains que permitem que fornecedores e tomadores de certos ativos digitais participem de mercados autônomos de taxas de juros (os “Protocolos”). Isso é feito pela Cashero Investment OÜ. Os juros também são gerados por empréstimos em libras esterlinas e euros como empréstimos garantidos a empresas sob a Cashero Financial OÜ. Os usuários podem retirar seus depósitos e juros do Cashero em GBP, EUR, USD ou em sua moeda local.",
    // DESCRIPTION_P2: "O Cashero não oferece serviço de câmbio de criptomoedas e não permite depósitos em criptomoeda.",
    // DESCRIPTION_P3: "Visando separar os elementos de suas atividades, o Cashero criou duas sociedades. Cashero Financial OÜ para transações financeiras tradicionais e Cashero Investment OÜ para as atividades que envolvam moedas virtuais. A Cashero Financial OÜ deterá a licença de instituição financeira e a Cashero Investment OÜ deterá a licença de serviços de moeda virtual.",
    // DESCRIPTION_P4: "Cashero Financial OÜ usa Sum And Substance Ltd, um provedor de serviços KYC, KYB e AML (proteção de dados nº ZA222205); Cashero Investment OÜ, um provedor de serviços de moeda virtual (licença nº XXXX);",
    DESCRIPTION_P1: "Cashero is a secure mobile-based application that provides a secure platform for high-yield savings, multi-currency wallets, and instant, fee-free internal and cross-border payments. Cashero allows users to deposit GBP, EUR, and USD to generate interest. Interest is generated by converting deposited GBP, EUR, and USD into a basket of cryptocurrency stablecoins i.e. DAI and USDC, which are invested into decentralized protocols on Ethereum and other blockchains that allow suppliers and borrowers of certain digital assets to participate in autonomous interest rate markets (the “Protocols”). This is done by Cashero Investment OÜ. Interest is also generated by lending GBP and EUR as collateralized loans to businesses under Cashero Financial OÜ. Users can withdraw their deposits and interest from Cashero in GBP, EUR, USD, or their local currency.",
    DESCRIPTION_P2: "Cashero does not provide a cryptocurrency exchange service and does not allow cryptocurrency deposits.",
    DESCRIPTION_P3: "Cashero has established two companies to separate elements of the business. Cashero Financial OÜ for traditional financial transactions and Cashero Investment OÜ for those that involve virtual currencies. Cashero Financial OÜ will hold the financial institution license and Cashero Investment OÜ will hold the virtual currency service license.",
    DESCRIPTION_P4: "Cashero Financial OÜ uses Sum And Substance Ltd a KYC, KYB and AML service provider (Data protection No. ZA222205); Cashero Investment OÜ a Virtual Currency Services provider (license No. XXXX);",
